window.bookSummaryJSON = "<p>Torrent Witches Complete Series Box Set!<br> All ten books in one!<br> <br> Meet Harlow Torrent, part-time journalist and full-time Slip Witch and her crazy witch family in this ten-book cozy mystery box set.<br> <br> Butter Witch (Torrent Witches Book 1)<br> The International Butter Festival has come to town! When Harlow Torrent, part-time journalist and full-time Slip witch stumbles upon a dead body, frozen and drained of blood, she's pulled into a murder mystery.</p> <p>Someone has murdered one of the Butter Festival competitors. Was it Zero Bend, punk sculptor extraordinaire with a history of violence? Perhaps Fusion Swan, a sleazy agent playing the publicity game when his clients meet their untimely end.</p> <p>Between trying to run her struggling online newspaper, dealing with her highly caffeinated cousins Molly and Luce, fending off three meddling witch mothers who will do anything to get their daughters married off (including drugging food with magic potions) and great Aunt Cass who appears to be running an underground laboratory of some kind, Harlow barely has time to breathe, let alone solve a murder.</p> <p>Romance certainly isn't on the cards either but the hot scruffy guy new to town seems to have other ideas...<br> <br> Treasure Witch (Torrent Witches Book 2)<br> Harlow Torrent, part-time journalist and full-time Slip Witch is pulled into a murder mystery when the skeletons of a man and a girl are uncovered on Truer Island.</p> <p>Seeing visions of the past that are all too real and ghosts who are becoming more solid by the day, Harlow is trying to keep her online newspaper running, dealing with her meddling witch family and working out what to do about the very handsome Jack Bishop being back in town.<br> But Harlow might be out of her depth when the murderer sets their sights on her!<br> <br> Hidden Witch (Torrent Witches Book 3)<br> Harlow Torrent, part-time journalist and full-time Slip Witch is hot on the trail of an arsonist.&nbsp;</p> <p>But who is behind the deadly fires? Someone working for their own evil ends or a fire spirit acting according to its nature? Or perhaps a magical power hidden away?</p> <p>Between dealing with sleazy real estate developers intent on getting their hands on Torrent Mansion, a teenage Slip Witch who just might be the Queen of Sarcasm, a talking magical cat who smells like lavender, and an AWOL potential future boyfriend, Harlow would love nothing more than a peaceful Summer.</p> <p>But when an special arson investigator arrives in town with his sights set on Harlow, she has to fight to clear her name! <br> <br> Fabulous Witch (Torrent Witches Book 4)<br> Harlow Torrent, part-time journalist and full-time Slip Witch has a new job working on the set of Bella Bing’s latest movie, filming in Harlot Bay.<br> It’s meant to be a change of pace but when the lead actor, Mattias Matterhorn, dies on his first day on set, Harlow is pulled into a dangerous plot.</p> <p>A saboteur is on set and they’ll do anything to shut the film down... including murder.</p> <p>With the ghost of Mattias demanding she find his murderer, her witchy cousins Molly and Luce tracking down a thief and her Aunt Cass getting into hot and spicy trouble, Harlow has her plate full. It doesn’t help one bit when she Slips and starts a magical storm...<br> <br> Holiday Witch (Torrent Witches Book 5)<br> Harlow Torrent, part-time journalist and full-time Slip Witch wants nothing more than to take a holiday from witchy things... but when a series of thefts around Harlot Bay turn deadly, she’s drawn into solving a murder mystery.</p> <p>Between murderous teenagers, a secret buried in the past, Hattie Stern on the warpath, Christmas approaching and Aunt Cass suffering a very froggy problem, Harlow is doing everything she can to enjoy her holiday but those witchy problems just won’t let her rest...<br> <br> Too much to fit here!<br> <br> Box set also includes Shadow Witch (#6), Love Witch (#7), Cozy Witch (#8), Lost Witch (#9) and the epic finale Wicked Witch (#10)!</p>"; 
